import Paper from '@mui/material/Paper'
import Box from '@mui/material/Box'
import Image from 'next/image'
import { Button } from '@mui/material'
import { signOut } from 'next-auth/react'

const getBlurDataURL = () => {
  return 'data:image/jpeg;base64,'
}

export default function UserProfile (props) {
  const blurDataURL = getBlurDataURL();
  const { callbackUrl } = props;
  const handleClick = () => {
    console.log("a click was handled");
    return signOut("spotify", { callbackUrl });
  }
  return (
    <>
      <Paper
        sx={{p:2}}
        elevation={1}
      >
        <Box sx={{ borderRadius: '4px', p:0, overflow: 'hidden', display: 'inline-block', height:300 }}> 
        {/* ^^^can't set the bottom border radius... */}
          <Image
            src={props?.user?.picture || blurDataURL}
            alt='Your Spotify profile image'
            blurDataURL={getBlurDataURL()}
            placeholder='blur'
            width={225}
            height={300}
          />
        </Box>
      </Paper>
      <Paper elevation={4}>
        <Button onClick={handleClick}>SIGN OUT</Button>
      </Paper>
    </>
  )
}
